volatile int pixel_buffer_start; // global variable

void draw_pixel(int x, int y, short int color)
{
    if (x < 0 || x > 320 || y < 0 || y > 240)
        return;
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = color;
}

void draw_text(int x, int y, char *text_ptr)
{
    int offset;
    volatile char *character_buffer = (char *)FPGA_CHAR_BASE;
    offset = (y << 7) + x;
    while (*(text_ptr))
    {
        *(character_buffer + offset) = *(text_ptr);
        ++text_ptr;
        ++offset;
    }
}

void swap(int *x, int *y)
{
    int temp = *x;
    *x = *y;
    *y = temp;
}

void draw_line(int x0, int y0, int x1, int y1, short int color)
{
    bool is_steep = abs(y1 - y0) > abs(x1 - x0);

    if (is_steep)
    {
        swap(&x0, &y0);
        swap(&x1, &y1);
    }

    if (x0 > x1)
    {
        swap(&x0, &x1);
        swap(&y0, &y1);
    }

    int deltax = x1 - x0;
    int deltay = abs(y1 - y0);
    int error = -(deltax / 2);

    int y_step;
    int y = y0;
    if (y0 < y1)
    {
        y_step = 1;
    }
    else
    {
        y_step = -1;
    }

    for (int x = x0; x < x1; x++)
    {
        if (is_steep)
        {
            draw_pixel(y, x, color);
        }
        else
        {
            draw_pixel(x, y, color);
        }

        error = error + deltay;
        if (error >= 0)
        {
            y = y + y_step;
            error = error - deltax;
        }
    }
}

void draw_rectangle(int x0, int y0, int x1, int y1, short int color)
{
    draw_line(x0, y0, x1, y0, color);
    draw_line(x1, y0, x1, y1, color);
    draw_line(x1, y1, x0, y1, color);
    draw_line(x0, y1, x0, y0, color);

    // fill the rectangle
    for (int i = x0 + 1; i < x1; i++)
    {
        for (int j = y0 + 1; j < y1; j++)
        {
            draw_pixel(i, j, color);
        }
    }
}

void wait_for_vsync()
{
    volatile int *pixel_ctrl_ptr = (int *)PIXEL_BUF_CTRL_BASE;
    *pixel_ctrl_ptr = 1;
    int status = *(pixel_ctrl_ptr + 3);
    while ((status & 0x01) != 0)
    {
        status = *(pixel_ctrl_ptr + 3);
    }
}

