void draw_background(int score, int y, const int background_left[], const int background_right[], const int road[])
{
    int counter_left = 0;
    int counter_right = 0;
    int counter_road = 0;
    for (int j = y; j < 240; j++)
    {
        for (int i = 0; i < 106; i++)
        {
            draw_pixel(i, j, background_left[counter_left]);
            counter_left++;
        }
    } // draw the left background between y and buttom

    for (int j = 0; j < y; j++)
    {
        for (int i = 0; i < 106; i++)
        {
            draw_pixel(i, j, background_left[counter_left]);
            counter_left++;
        }
    } // draw the left background between 0 and y

    for (int j = y; j < 240; j++)
    {
        for (int i = 214; i < 320; i++)
        {
            draw_pixel(i, j, background_right[counter_right]);
            counter_right++;
        }
    } // draw the right background between y and buttom

    for (int j = 0; j < y; j++)
    {
        for (int i = 214; i < 320; i++)
        {
            draw_pixel(i, j, background_right[counter_right]);
            counter_right++;
        }
    } // draw the right background between 0 and y

    for (int j = y; j < 240; j++)
    {
        for (int i = 106; i < 214; i++)
        {
            draw_pixel(i, j, road[counter_road]);
            counter_road++;
        }
    } // draw the road between y and buttom

    for (int j = 0; j < y; j++)
    {
        for (int i = 106; i < 214; i++)
        {
            draw_pixel(i, j, road[counter_road]);
            counter_road++;
        }
    } // draw the road between 0 and y

    draw_score(score);
}

