/*
 * Turn off interrupts in the ARM processor
 */
void disable_A9_interrupts(void)
{
    int status = 0b11010011;
    __asm__("msr cpsr, %[ps]"
            :
            : [ps] "r"(status));
}
/*
 * Initialize the banked stack pointer register for IRQ mode
 */
void set_A9_IRQ_stack(void)
{
    int stack, mode;
    stack = 0xFFFFFFFF - 7; // top of A9 onchip memory, aligned to 8 bytes
    /* change processor to IRQ mode with interrupts disabled */
    mode = 0b11010010;
    __asm__("msr cpsr, %[ps]"
            :
            : [ps] "r"(mode));
    /* set banked stack pointer */
    __asm__("mov sp, %[ps]"
            :
            : [ps] "r"(stack));
    /* go back to SVC mode before executing subroutine return! */
    mode = 0b11010011;
    __asm__("msr cpsr, %[ps]"
            :
            : [ps] "r"(mode));
}
/*
 * Turn on interrupts in the ARM processor
 */
void enable_A9_interrupts(void)
{
    int status = 0b01010011;
    __asm__("msr cpsr, %[ps]"
            :
            : [ps] "r"(status));
}
/*
 * Configure the Generic Interrupt Controller (GIC)
 */
void config_GIC(void)
{
    config_interrupt(73, 1); // configure the FPGA KEYs interrupt (73)
    // Set Interrupt Priority Mask Register (ICCPMR). Enable interrupts of all
    // priorities
    *((int *)0xFFFEC104) = 0xFFFF;
    // Set CPU Interface Control Register (ICCICR). Enable signaling of
    // interrupts
    *((int *)0xFFFEC100) = 1;
    // Configure the Distributor Control Register (ICDDCR) to send pending
    // interrupts to CPUs
    *((int *)0xFFFED000) = 1;
}
/*
 * Configure Set Enable Registers (ICDISERn) and Interrupt Processor Target
 * Registers (ICDIPTRn). The default (reset) values are used for other registers
 * in the GIC.
 */
void config_interrupt(int N, int CPU_target)
{
    int reg_offset, index, value, address;
    /* Configure the Interrupt Set-Enable Registers (ICDISERn).
     * reg_offset = (integer_div(N / 32) * 4
     * value = 1 << (N mod 32) */
    reg_offset = (N >> 3) & 0xFFFFFFFC;
    index = N & 0x1F;
    value = 0x1 << index;
    address = 0xFFFED100 + reg_offset;
    /* Now that we know the register address and value, set the appropriate bit */
    *(int *)address |= value;
    /* Configure the Interrupt Processor Targets Register (ICDIPTRn)
     * reg_offset = integer_div(N / 4) * 4
     * index = N mod 4 */
    reg_offset = (N & 0xFFFFFFFC);
    index = N & 0x3;
    address = 0xFFFED800 + reg_offset + index;
    /* Now that we know the register address and value, write to (only) the
     * appropriate byte */
    *(char *)address = (char)CPU_target;
}
/********************************************************************
 * Pushbutton - Interrupt Service Routine
 *
 * This routine checks which KEY has been pressed. It writes to HEX0
 *******************************************************************/
void pushbutton_ISR(void)
{
    volatile int *KEY_ptr = (int *)KEY_BASE; // pushbutton KEY address
    int press;
    press = *(KEY_ptr + 3); // read the pushbutton interrupt register
    *(KEY_ptr + 3) = press; // Clear the interrupt

    if (press & 0x1)
    {
        key_dir = 1;
    }
    else if (press & 0x4)
    {
        key_dir = 2;
    }
    else if (press & 0x8)
    {
        key_dir = 3;
    }
    return;
}

#define LEFT_TRACK 109
#define MIDDLE_TRACK 145
#define RIGHT_TRACK 181

#define SHORT_TRAIN 80
#define LONG_TRAIN 120

#define NUM_TRACKS 3

// Global variables
int SCREEN_WIDTH = 320;
int SCREEN_HEIGHT = 240;
volatile int pixel_buffer_start; // global variable

void spawn_trains(Train *train1, Train *train2, bool *track1_free, bool *track2_free, bool *track3_free)
{
    if (train1->y > SCREEN_HEIGHT + train1->height)
    {
        int current_track_1 = train1->track;
        // if the train was on track 1, set track1_free to true
        if (current_track_1 == 1)
        {
            *track1_free = true;
        }
        // if the train was on track 2, set track2_free to true
        else if (current_track_1 == 2)
        {
            *track2_free = true;
        }
        // if the train was on track 3, set track3_free to true
        else if (current_track_1 == 3)
        {
            *track3_free = true;
        }

        int train_length = rand() % 2 + 1; // choose a random train length
        int train_speed = rand() % 3 + 1;  // choose a random train speed
        train1->speed = train_speed;
        bool train1_spawned = false;
        while (!train1_spawned)
        {
            train1->x = rand() % 3 + 1; // choose a random track
            if (train1->x == 1 && *track1_free)
            {
                train1->x = LEFT_TRACK;
                train1->track = 1;
                if (train_length == 1)
                {
                    train1->height = SHORT_TRAIN;
                }
                else if (train_length == 2)
                {
                    train1->height = LONG_TRAIN;
                }
                *track1_free = false;
                train1_spawned = true;
                train1->y = 0;
            }
            else if (train1->x == 2 && *track2_free)
            {
                train1->x = MIDDLE_TRACK;
                train1->track = 2;
                if (train_length == 1)
                {
                    train1->height = SHORT_TRAIN;
                }
                else if (train_length == 2)
                {
                    train1->height = LONG_TRAIN;
                }
                *track2_free = false;
                train1_spawned = true;
                train1->y = 0;
            }
            else if (train1->x == 3 && *track3_free)
            {
                train1->x = RIGHT_TRACK;
                train1->track = 3;
                if (train_length == 1)
                {
                    train1->height = SHORT_TRAIN;
                }
                else if (train_length == 2)
                {
                    train1->height = LONG_TRAIN;
                }
                *track3_free = false;
                train1_spawned = true;
                train1->y = 0;
            }
        }

    } // respawn train1

    if (train2->y > SCREEN_HEIGHT + train2->height)
    {
        int current_track_2 = train2->track;
        // if the train was on track 1, set track1_free to true
        if (current_track_2 == 1)
        {
            *track1_free = true;
        } // if the train was on track 2, set track2_free to true
        else if (current_track_2 == 2)
        {
            *track2_free = true;
        }
        // if the train was on track 3, set track3_free to true
        else if (current_track_2 == 3)
        {
            *track3_free = true;
        }

        int train2_length = rand() % 2 + 1;
        int train2_speed = rand() % 3 + 1;
        train2->speed = train2_speed;
        bool train2_spawned = false;
        while (!train2_spawned)
        {
            train2->x = rand() % 3 + 1; // choose a random track
            if (train2->x == 1 && *track1_free)
            {
                train2->x = LEFT_TRACK;
                train2->track = 1;
                if (train2_length == 1)
                {
                    train2->height = SHORT_TRAIN;
                }
                else if (train2_length == 2)
                {
                    train2->height = LONG_TRAIN;
                }
                *track1_free = false;
                train2_spawned = true;
                train2->y = 0;
            }
            else if (train2->x == 2 && *track2_free)
            {
                train2->x = MIDDLE_TRACK;
                train2->track = 2;
                if (train2_length == 1)
                {
                    train2->height = SHORT_TRAIN;
                }
                else if (train2_length == 2)
                {
                    train2->height = LONG_TRAIN;
                }
                *track2_free = false;
                train2_spawned = true;
                train2->y = 0;
            }
            else if (train2->x == 3 && *track3_free)
            {
                train2->x = RIGHT_TRACK;
                train2->track = 3;
                if (train2_length == 1)
                {
                    train2->height = SHORT_TRAIN;
                }
                else if (train2_length == 2)
                {
                    train2->height = LONG_TRAIN;
                }
                *track3_free = false;
                train2_spawned = true;
                train2->y = 0;
            }
        }

    } // respawn train2
}

void update_game(bool move_left, bool move_right, Player *player,
                 Train *train1, Train *train2,
                 int *player_track, bool *collision, int *gamespeed, int *speedup_counter, int *score,
                 bool *track1_free, bool *track2_free, bool *track3_free)
{
    // Update the game state
    if (move_left)
    {
        if (*player_track == 1)
        {
            *player_track = 1;
            // do not move player
        } // do nothing
        else if (*player_track == 2)
        {
            *player_track = 1;
            player->x = LEFT_TRACK; // move player to left track;
        }
        else if (*player_track == 3)
        {
            *player_track = 2;
            player->x = MIDDLE_TRACK; // move player to middle track;
        }
        move_left = false;
    }

    if (move_right)
    {
        if (*player_track == 1)
        {
            *player_track = 2;
            player->x = MIDDLE_TRACK; // move player to middle track;
        }
        else if (*player_track == 2)
        {
            *player_track = 3;
            player->x = RIGHT_TRACK; // move player to right track;
        }
        else if (*player_track == 3)
        {
            *player_track = 3;
            // do not move player
        } // do nothing
        move_right = false;
    }

    // move the trains downwards

    train1->y = train1->y + train1->speed + (*gamespeed);
    train2->y = train2->y + train2->speed + (*gamespeed);

    spawn_trains(train1, train2, track1_free, track2_free, track3_free);
    *speedup_counter = *speedup_counter - 1;
    if (*speedup_counter == 0)
    {
        *gamespeed = *gamespeed + 1;
        *speedup_counter = 300;
    } // speed up the game every 300 frames, 5 seconds

    *score = *score + 1;
}

