int main()
{
    disable_A9_interrupts(); // disable interrupts in the A9 processor
    set_A9_IRQ_stack();      // initialize the stack pointer for IRQ mode
    config_GIC();            // configure the general interrupt controller
    config_KEYs();           // configure pushbutton KEYs to generate interrupts
    enable_A9_interrupts();  // enable interrupts in the A9 processor
    volatile int *pixel_ctrl_ptr = (int *)0xFF203020;
    bool running = true;

    tick = 0;
    key_dir = 0;

    // Initialize Player, Trains, coins and score
    Player player;
    Train train1;
    Train train2;
    int score = 0;
    int train1_color = 0x001F;
    int train2_color = 0x07E0;

    int gamespeed = 1;
    int speedup_counter = 300;

    int player_track = 2;

    bool move_right = false;
    bool move_left = false;

    bool track1_free = true;
    bool track2_free = true;
    bool track3_free = true;

    volatile bool reset = false;

    srand(time(NULL)); // seed the random number generator

    // Initialize the game
    initialize_game(&player, &train1, &train2, train1_color, train2_color, &score, &player_track);

    /* set front pixel buffer to start of FPGA On-Chip memory */
    *(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the back buffer
    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();
    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen(); // pixel_buffer_start points to the pixel buffer
    /* set back pixel buffer to start of SDRAM memory */
    *(pixel_ctrl_ptr + 1) = 0xC0000000;         // we draw on the back buffer
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we now draw on the back buffer
    clear_screen();

    bool respawn = true;
    bool collision = false;

    int background_y = 0;

    while (running)
    {
        clear_screen();
        process_input(&move_left, &move_right, &reset);

        update_game(move_left, move_right, &player, &train1, &train2,
                    &player_track, &collision, &gamespeed, &speedup_counter,
                    &score, &track1_free, &track2_free, &track3_free);

        if (background_y > 239)
        {
            background_y = 1;
        }
        else
        {
            background_y += 1;
        }

        move_left = false;
        move_right = false;

        // detect collision

        if (rectanglesCollide(player, train1))
        {
            render_game_gameover(score, &train1, &train2, &player, player_map, short_train_map, long_train_map, game_over_map, background_y, background_right, background_left, road);
            pixel_buffer_start = *(pixel_ctrl_ptr + 1);
            while (!reset)
            {
                process_input(&move_left, &move_right, &reset);
            }
            reset = false;
            initialize_game(&player, &train1, &train2, train1_color, train2_color, &score, &player_track);
            track1_free = true;
            track2_free = true;
            track3_free = true;
            spawn_trains_respawn(&train1, &train2, &track1_free, &track2_free, &track3_free);
            gamespeed = 1;
            background_y = 0;
            continue;
        }
        if (rectanglesCollide(player, train2))
        {
            render_game_gameover(score, &train1, &train2, &player, player_map, short_train_map, long_train_map, game_over_map, background_y, background_right, background_left, road);
            pixel_buffer_start = *(pixel_ctrl_ptr + 1);
            while (!reset)
            {
                process_input(&move_left, &move_right, &reset);
            }
            reset = false;
            initialize_game(&player, &train1, &train2, train1_color, train2_color, &score, &player_track);
            track1_free = true;
            track2_free = true;
            track3_free = true;
            spawn_trains_respawn(&train1, &train2, &track1_free, &track2_free, &track3_free);
            gamespeed = 1;
            background_y = 0;
            continue;
        }

        render_game(score, &train1, &train2, &player, player_map, short_train_map,
                    long_train_map, background_y, background_right, background_left, road);

        pixel_buffer_start = *(pixel_ctrl_ptr + 1);
    }

    return 0;
}
